import * as React from 'react';
import "./Navbar.css"

const Navbar = () => {
    return (
        <ul>
            <a href="/">Home</a>
            <a href="/asdffeatures">Features</a>
            <a href="/rewards">Rewards</a>
            <a href="/about">About</a>
        </ul>
    )
}

export default Navbar;
